name: delete-trained-model-output
description: Deletes the model artifacts stored by the service.
flags:
    --membership-identifier=!: The membership ID of the member that is deleting the trained model output.
    --trained-model-arn=!: The Amazon Resource Name (ARN) of the trained model whose output you want to delete.
    --version-identifier=: The version identifier of the trained model to delete.
